                    <h1 id="tower1">Tower</h1>
                    <h1 id="tower2">Tower</h1>
                    <h1 id="tower3">Tower</h1>
                    <h1 id="tower4">Tower</h1>
                </div>
            </div>
        );
    }
}

export default Field;
